import React, { Component } from "react";
import { Card, ProgressBar } from "react-bootstrap";

export default PlaylistItem = ({playlistItem}) => {
  
    return (
      <>
        <Card>
          <Card.Body>
            <Card.Title>{playlistItem.playlist_name}</Card.Title>
            <Card.Text>
            {playlistItem.playlist_channel}
            </Card.Text>
            <ProgressBar now={60} />
          </Card.Body>
        </Card>
      </>
    );
}
